import pandas as pd
import numpy as np

"""Pythonによる単純集計"""

df = pd.read_csv("fruits.csv")

print(df)

# groupby関数：同じ値を持つデータをまとめて、それぞれに対して共通の操作を行いたい時に用いる
# size関数：参照される変数に割り当てられたバイト数を示す
# 単純集計をする際に利用する
print(df.groupby('fruits').size())

# mean関数：数値の平均を表示する
# fruitsごとの平均を算出する
print(df.groupby('fruits').mean())

# sum関数：数値の合計を算出する
# fruitsごとの合計を算出する（price、quantityのみ数値があるのでそれを表示する）
print(df.groupby('fruits').sum())

# groupby(['項目名','項目名'])：groupby関数内にセルの項目を指定することができる

# 一つのセルで何個も表示せるためにprint()が必要
print(df.groupby(['fruits','country']).sum())
# df.groupby(['fruits','country']).sum()

"""クロス集計とは

▪ 属性と属性をかけ合わせて集計する方法

▪ 単純集計で得られた全体の回答傾向が、性別や年齢別などの属性に よって異なってくるのかについて調査すること
"""

# crosstab関数：クロス集計を行う際に用いる
#fruits属性 と country属性 のクロス集計を行う
print(pd.crosstab(df['fruits'],df['country']))

# margins属性を True にすると総計が表示される
print(pd.crosstab(df['fruits'],df['country'],margins=True))

# normalize属性を True にすると全分母の%が表示される
print(pd.crosstab(df['fruits'],df['country'],margins=True,normalize=True))

# normalize属性を index にすると横分母の%が表示される
print(pd.crosstab(df['fruits'],df['country'],margins=True,normalize='index'))

# ▪normalize属性を columns にすると縦分母の%が表示される
print(pd.crosstab(df['fruits'],df['country'],margins=True,normalize='columns'))

"""ピボットテーブル

▪ Excelなどの表計算ソフトで使われるピボットテーブルと類似した機能が pandasにも備わっている

▪ pivot_table関数を用いるとデータを任意の形式で効率よく集計可能
"""

# pivot_table関数：ピボットテーブルを作成する際に用いる
# index：行ラベルを指定
# columns：列ラベルを指定
# values：集計項目を指定
# aggfunc：集計方法を指定(省略するとnumpy.mean())

# 価格の合計を表示する
print(pd.pivot_table(df,index='fruits',columns='country',values='price',aggfunc='sum'))

# aggfunc='size'で件数を表示
print(pd.pivot_table(df,index='fruits',columns='country',values='price',aggfunc='size'))

# aggfunc=np.minで最小値を表示
print(pd.pivot_table(df,index='fruits',columns='country',values='price',aggfunc=np.min))

# aggfuncを指定しない場合（デフォルト）は平均を表示する
print(pd.pivot_table(df,index='fruits',columns='country',values='price'))

