"""2017年と2018年の時系列データを月別で集計し、各月の平均を棒 グラフで可視化しなさい

**OPEN情報を可視化**
"""

# data_concatedに"month"項目を追加する
data_concated["month"] = data_concated.index
# data_concatedの"month"項目の表示を年月のみで表示する
data_concated["month"] = data_concated["month"].dt.strftime("%Y%m")

# 月データの平均を出し、month_dataに格納する
month_data = data_concated.groupby(["month"]).mean()
# X軸にmonth_dataのX軸（年月）を指定。Y軸にはmonth_dataの"open"を指定。グラフ色は赤。ラベルは"open"を指定。
plt.bar(month_data.index, month_data["open"], color="red", label="open")
plt.xlabel("DATETIME")
plt.ylabel("EURUSD")
plt.legend()
plt.show()

"""HIGH情報を可視化"""

plt.bar(month_data.index,month_data["high"],color="green",label="HIGH")
plt.xlabel("DATETIME")
plt.ylabel("EURUSD")
plt.legend()
plt.show()

"""LOW情報を可視化"""

plt.bar(month_data.index,month_data["low"],color="blue",label="LOW")
plt.xlabel("DATETIME")
plt.ylabel("EURUSD")
plt.legend()
plt.show()

"""CLOSE情報を可視化"""

plt.bar(month_data.index,month_data["close"],color="black",label="CLOSE")
plt.xlabel("DATETIME")
plt.ylabel("EURUSD")
plt.legend()
plt.show()

"""SPREAD情報を可視化"""

plt.bar(month_data.index,month_data["spread"],color="yellow",label="SPREAD")
plt.xlabel("DATETIME")
plt.ylabel("EURUSD")
plt.legend()
plt.show()

